DISCLOSURE_INFO:
{
  "Initiated By" : "UNITED STATES SECURITIES AND EXCHANGE COMMISSION",
  "Allegations" : "SEC LITIGATION RELEASE 20598, MAY 23, 2008: THE SECURITIES AND EXCHANGE COMMISSION FILED COMPLAINT AGAINST RESPONDENT AND OTHERS ALLEGED SECURITIES FRAUD FOR THEIR PARTICIPATION IN A FRAUDULENT SCHEME TO EVADE REGISTRATION REQUIREMENTS AND ENGAGING IN A \"PUMP AND DUMP\" STOCK MANIPULATION SCHEME.  THE COMMISSION'S COMPLAINT CHARGES PANELLA WITH VIOLATING SECTION 5(A) AND 5(C) OF THE SECURITIES ACT AND SECTION 10(B) AND RULE 10B-5 THEREUNDER: SALE OF UNREGISTERED SECURITIES AND FRAUD. THE COMMISSION'S COMPLAINT ALLEGES THAT FROM JUNE THROUGH AUGUST 2005, DEFENDANTS ENGAGED IN A COMPLEX SCHEME TO EVADE THE REGISTRATION REQUIREMENTS BY OBTAINING A FRAUDULENTLY BACKDATED CONVERTIBLE PROMISSORY NOTE, USING A FORGED ASSIGNMENT TO ASSIGN THE NOTE TO THREE FOREIGN ENTITIES AND THEN CONVERTING THE NOTE INTO UNRESTRICTED FIRM SHARES. THE COMPLAINT FURTHER ALLEGES THAT THE DEFENDANTS ENGAGED IN A \"PUMP-AND-DUMP\" SCHEME BY ARRANGING FOR FIRM TO ISSUE NUMEROUS PRESS RELEASES THAT CONTAINED FALSE AND MISLEADING INFORMATION RELATING TO FIRM'S PURPORTED CLIENTS, PENDING CONTRACTS AND REVENUE PROJECTIONS. IN ADDITION, DEFENDANT PANELLA SOLD ILLEGALLY ISSUED FIRM SHARES FOR PROFITS OF NEARLY $1.1 MILLION. PANELLA ASSISTED FIRM WITH THE REVERSE MERGER WITH THE SHELL CORPORATION, AND WAS AFFILIATED WITH THE INVESTOR RELATIONS FIRM IN THE MIDDLE DISTRICT THAT HELPED FIRM DISSEMINATE ITS FALSE AND MISLEADING PUBLIC STATEMENTS.",
  "Resolution" : "Judgment Rendered",
